import ChatUserList from './ChatUserList';
import ChatMessageList from './ChatMessageList';
const ShowStuff = ({ user }) => {
  console.log(user);
  return (
    <ul>
      {Object.values(user.userList).map( user => (
        <li>
            <div class="user">
            <span class="username">{user}</span>
            </div>
        </li> ) ) }
    </ul>
  );
};
export default ShowStuff;
